import React from 'react';
import { View, Text, Button } from 'react-native';
import { createStackNavigator } from '@react-navigation/stack';

const Stack = createStackNavigator();

function CustomHeader({ navigation }) {
  return (
    <View style={{ flexDirection: 'row', justifyContent: 'space-between', alignItems: 'center', padding: 10 }}>
      <Button title="Voltar" onPress={() => navigation.goBack()} />
      <Text>Seu Título</Text>
      <View style={{ width: 50 }}></View> {/* Espaço reservado para o botão à direita, se necessário */}
    </View>
  );
}

function SeuComponente() {
  return (
    <View>
      <Text>Conteúdo do seu componente aqui.</Text>
    </View>
  );
}

function SeuNavigator() {
  return (
    <Stack.Navigator>
      <Stack.Screen
        name="SeuComponente"
        component={SeuComponente}
        options={{
          header: (props) => <CustomHeader {...props} />,
        }}
      />
    </Stack.Navigator>
  );
}

export default SeuNavigator;
